import React from 'react'
import Styles from "../Home.module.css";


const Home = () => {
    return (
      <>
      <div></div>
      <div className={Styles.homediv}>
        <div className={Styles.homecontent}>
          <p className={Styles.text}>WELCOME</p>
          <h1>we are the MERN develeoper</h1>
        </div>
        </div>
        </>
    )
}

export default Home
